import {React, useState} from "react";
import "./App.css";
import Nav from "./Components/nav/Nav";
import Section0 from "./Components/section0/Section0";
import Section1 from "./Components/section1/Section1";
import Section2 from "./Components/section2/Section2";
import Section3 from "./Components/section3/Section3";
import Section4 from "./Components/section4/Section4";
import Detail1 from "./Components/detail/Detail1";
import Detail2 from "./Components/detail/Detail2";
import Detail3 from "./Components/detail/Detail3";
import Detail4 from "./Components/detail/Detail4";
import Detail5 from "./Components/detail/Detail5";
import Detail6 from "./Components/detail/Detail6";
import Detail7 from "./Components/detail/Detail7";
import Detail8 from "./Components/detail/Detail8";
import Detail9 from "./Components/detail/Detail9";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./Components/Home";

const numofmem = ["1", "2", "3", "4", "5", "6", "7", "8", "9"];

function App() {
  const [formValue, setFormValue] = useState({
    NumMem: "",
    Device_id: "",
    User_id: "",
    username: ""
  });
  return (
    <div>
      <div className="App">
      <div className="form">
        <div className="form-item">
          <h1>1. 이름이 무엇인가요?</h1>
           // props로 넘겨줄 값들을 설정해주자. 여기엔 이름이 들어갈것이므로 state를 formValue.name으로 설정
          <TextInput
            value={formValue.name}
            // Textinput에서 값이 변경되면 setFormValue로 폼의 값도 변경시켜줄것이다.
            setValue={(value) => {
              setFormValue((state) => ({
                // name을 제외한 나머지 값들도 얕은복사로 가져오기.
                ...state,
                name: value
              }));
            }}
          />
        </div>
        <div className="form-item">
          <h1>2. 사는 곳은 어딘가요?</h1>
          <Select
            // 이름과 마찬가지로 contry값 설정
            value={formValue.contry}
            setValue={(value) => {
              setFormValue((state) => ({
                ...state,
                contry: value
              }));
            }}
            // 추가로 셀렉박스에 넘겨줄 리스트를 props에 넣어준다.
            options={numofmem}
          />
        </div>
        // 폼의 contry의 값이 한국일 때만 추가로 텍스트인풋을 열어주기 위해 and연산자 활용
        {formValue.contry === "한국" && (
          <div className="form-item">
            <h1>2-1. 한국 어디에 사나요?</h1>
            <TextInput
              // 위 이름폼과 동일한 내용
              value={formValue.address}
              setValue={(value) => {
                setFormValue((state) => ({
                  ...state,
                  address: value
                }));
              }}
            />
          </div>
        )}
        <div className="button-group">
          <button
            // 클릭시 저장되었다는 얼럿창과 함께 폼 초기화시켜주기
            onClick={() => {
              alert("저장되었습니다.");
              setFormValue({
                NumMem: "",
                Device_id: "",
                User_id: "",
                username: ""
              });
            }}

            disabled={!formValue.name || !formValue.contry}
          >
            저장
          </button>
        </div>
      </div>
    </div>
        <BrowserRouter>
          <Routes>
            <Route path={"/"} element={<Home />} />
            <Route path="/Nav" element={<Nav />} />
            <Route path="/Section0" element={<Section0 />} />
            <Route path="/Section1" element={<Section1 />} />
            <Route path="/Section2" element={<Section2 />} />
            <Route path="/Section3" element={<Section3 />} />
            <Route path="/Section4" element={<Section4 />} />
            <Route path="/Detail1" element={<Detail1 />} />
            <Route path="/Detail2" element={<Detail2 />} />
            <Route path="/Detail3" element={<Detail3 />} />
            <Route path="/Detail4" element={<Detail4 />} />
            <Route path="/Detail5" element={<Detail5 />} />
            <Route path="/Detail6" element={<Detail6 />} />
            <Route path="/Detail7" element={<Detail7 />} />
            <Route path="/Detail8" element={<Detail8 />} />
            <Route path="/Detail9" element={<Detail9 />} />
          </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
